(()=>{function n(t){t.magic("page",e=>{let a=t.$data(e);if(!a||typeof a.page!="function")throw new Error("Alpine data must have a 'page' function");return a.page}),t.directive("page",e=>{let a=t.$data(e);if(!a||typeof a.page!="function")throw new Error("Alpine data must have a 'page' function");t.effect(()=>{e.innerHTML=a.page()})})}document.addEventListener("alpine:init",()=>window.Alpine.plugin(n));})();
